import React from "react";
import { useForm } from "react-hook-form";
import "./App.css";

function App() {
  const { handleSubmit } = useForm();

  const onSubmit = (data) => console.log(data);

  return (
    <div className="App">
      <header className="App-header"></header>
      <main>
        <form onSubmit={handleSubmit(onSubmit)}></form>
      </main>
    </div>
  );
}

export default App;
